import Head from "next/head";

import Form from "./form/Form.js";

export default function App() {
  return (
    <>
      <Head>
        <title>Test Fulogy</title>
        {/* <link rel="icon" href="/favicon.ico" /> */}
      </Head>
      <main>
        <h1 className="hidden">Форма</h1>
        <section className="mainContent">
          <Form />
        </section>
      </main>

      <style jsx>
        {`
          .mainContent {
            width: 100%;
            height: 500px;
            background: url("/rectangle.png") top center / contain no-repeat;
          }
        `}
      </style>
      <style jsx global>
        {`
          html,
          body {
            margin: 0;
            padding: 0;
          }
          .hidden {
            position: absolute;
            visibility: hidden;
          }
        `}
      </style>
    </>
  );
}
